import React from 'react'
import InstituteSideBar from '../../components/instituteSideBar'
import '../../styles/institute/insManageCourses.css'

function ManageCourses() {

  const addCourse = [
    {
      name:'Course Name',
      id : 'courseName',
      type : 'text'
    },

    {
      name:'Institute Name',
      id : 'instituteName',
      type : 'text'
    },

    {
      name:'Course Overview',
      id : 'courseOverview',
      type : 'text'
    },

    {
      name:'Course Content',
      id : 'courseContent',
      type : 'text'
    },

    {
      name:'Course Payment',
      id : 'coursePayment',
      type : 'text'
    },

    {
      name:'Minimum Result',
      id : 'minimumResult',
      type : 'text'
    },

     {
      name:'AL subject Stream',
      id : 'subjectStream',
      type : 'text'
    },

    {
      name:'Z core',
      id : 'zCore',
      type : 'text'
    },

    {
      name:'Add images',
      id : 'images',
      type : 'text'
    },
  ]
  return (
    <div>     
      <div className="institute">
        <div className="instituteSideBar">
        <InstituteSideBar/>
      </div>

      <div className="instituteContent">
      <h2>Add your Course</h2>    
          {
            addCourse.map((item,index) => {
              return(              
                  <form action="" >
                    <div className="insCourseInputs">
                       <input type="text" placeholder={item.name} id={item.id} />
                    </div> 
                  </form>     
                               
              )
            })
          }

          <button>Add</button>

  
        </div>
      </div>

      </div>  
  )
}

export default ManageCourses
